import React, { Component } from "react";

class UpdateEmployee extends Component {
    constructor() {
        super();
        this.state = {
            name: this.props.name
        }
    }
    render() {
        return (
            <div>Hello {this.props.location.state.name}</div>
        )
    }
}

export default UpdateEmployee;
